import { Injectable } from '@angular/core';
import { StrangePeopele } from 'src/interfaces/StrangePeople';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})

export class TestserviceService {
   url = "/home/dev_ladzi/learning-Angular/hello-world/src/assets/strangePeople.json";
  private people: StrangePeopele = [];

  constructor(private http: HttpClient) {}
  getPeople(){
    return this.http.get(this.url).subscribe( (data) => this.people = data);
  }
}
